class LinearRegression:
    def __init__(self, lr=0.01, n_iters=1000):#set two input parameters, lr and n_iters
    #self.cost stores all cost values
        self.lr = lr
        self.n_iters = n_iters
        self.cost = np.zeros(self.n_iters)

    def train(self, x, y):#initialise self.theta with random values
        self.theta =np.random.randn(x.shape[1],1)
        thetas,costs=GradientDescent(x,y,self.theta,self.lr,self.n_iters)
        self.theta=thetas
        self.cost=costs
        return self

    def predict(self, x):#hypothesis
        return np.dot(x, self.theta)

def GradientDescent(X,y,theta,lr=0.01,n_iters=100):
  #theta are the initial values
  #lr is learning rate
  #returned are final parameters and costs keeps all cost values during iterations
    m = len(y)
    costs = []
    for _ in range(n_iters):
        y_hat = np.dot(X,theta)
        theta = theta -(1/m) * lr * (np.dot(X.T,(y_hat - y)))#updating parameter value
        cost = (1/2*m) * np.sum(np.square(y_hat-y))#our cost function
        costs.append(cost)
        print("Y intercept and gradient {} and cost {}".format(theta,cost))
    #plt.plot(theta,color='g')
    #_ =plt.axis([0.3,1,1,2.8])
    return theta, costs

